import React from 'react'
import { useTrafficStore } from '../../store/useTrafficStore';

type CardProps = {
    title: string;
  };

const OptionalComponent = ({title}: CardProps) => {
  const { getMessageCodeCount } = useTrafficStore();
  return (
    <div className='container bg-black text-white rounded-2xl p-4 flex-col gap-4 w-[400px] h-[400px]'>
        <h2 className="text-lg font-bold mb-4">{title}</h2>
        <div className='bg-teal-300 h-[300px] flex flex-col justify-center items-center gap-4'>
        <div>
        <p><span className='font'>Liten påverkan: </span>{getMessageCodeCount("Liten påverkan")}</p>
        </div>
        <div>
        <p>Stor påverkan: {getMessageCodeCount("Stor påverkan")}</p>
        </div>
        <div>
        <p>Ingen påverkan: {getMessageCodeCount("Ingen påverkan")}</p>
        </div>
        </div>
    </div>
  )
}

export default OptionalComponent
